import React, { useState, useEffect } from "react";
import axios from "axios";

const TestNftArtViewer = () => {
  const [nftArt, setNftArt] = useState(null);

  const fetchNftArt = async (url) => {
    try {
      const response = await axios.get(url);
      const metadata = response.data;

      setNftArt(metadata.image);
    } catch (error) {
      console.log(error);
    }
  };

  useEffect(() => {
    fetchNftArt("https://opensea.io/assets/0x8c714199d2ea08cc1f1f39a60f5cd02ad260a1e3/1");
  }, []);

  return (
    <div>
      <img src={nftArt} alt="" />
    </div>
  );
};

export default TestNftArtViewer;
